import logo from './logo.svg';
import './App.css';
function App() {
  const info=[
    {name:'reza',id:1},
    {name:'ali',id:2},
    {name:'tree',id:3},
    {name:'young',id:4},
    {name:'asqar',id:5},
    {name:'meti',id:6},
  ] 
  return (
    <div>
    {info.map((person)=>{
      <h1>person</h1>
    })}     
    </div>
  );
}

export default App;
